import styled from "styled-components"
export const AppDiv=styled('div')`
height: var(--inner-navbar-height);
    position: fixed;
    top: 0px;
    left: 0px;
    width: 100%;
    z-index: 9;
    border-bottom: 1px solid rgba(83, 83, 83, 0.13);
    padding: 1.5rem 4rem;
    display: flex;
    background-color: rgb(255, 255, 255);
    -webkit-box-pack: justify;
    justify-content: space-between;
    -webkit-box-align: center;
    align-items: center;
}
`
export const StyledImage = styled('img')`
  width: 100%;
  max-width: 400px; // Adjust the maximum width as needed
  height: auto;
  border-radius: 8px; // Optional: Add rounded corners
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1); // Optional: Add a shadow effect
`;
export const CenterAppbar=styled('div')`
    display: inline-flex;
    gap: 2rem;
    flex: 0 1 auto;
    -webkit-box-pack: center;
    justify-content: center;
    place-self: center;
    margin: 0px;
    padding: 0px;
    list-style: none;
}
`;
export const Appbar=()=>{

    return <AppDiv>
        <StyledImage src=".\assets\logos\Logo_with_text.svg" ></StyledImage>
        jokoko

    </AppDiv>
}
